import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import { Button } from 'react-bootstrap';

const Header = () => 
{
    return (
        <Navbar bg="dark" data-bs-theme="dark">
            <Container className='p-0'>
            <Navbar.Brand href="/">BlackoutStore</Navbar.Brand>
            <Nav className="me-auto">
                <Nav.Link href="/">Головна сторінка</Nav.Link>
                <Nav.Link href="/MyOrders">Мої замовлення</Nav.Link>
                <Nav.Link href="#AboutUs">Про нас</Nav.Link>
                <Nav.Link href="#AddProduct">Додати товар</Nav.Link>
            </Nav>
            <Nav>
                <Button variant="light" /*onClick={()=> ShowAuthModalForm()}*/  className='m-1'>Login</Button>
                <Button variant="danger" /*onClick={()=>{ Logout() }}*/ className='m-1'>Logout</Button>
            </Nav>
            </Container>
        </Navbar>
    );
}

export default Header;
